import React from 'react';
import './App.css';

const tasks = ['Acordar', 'tomar café', 'arrumar a cama', 'estudar'];

const taskList = () => ( <ul>{ tasks.map(task => <li>{ task }</li>) }</ul> );

export default taskList;
